import React, { props } from "react";

export default function Prikazivanje(props) {
  let alo = props.podaci.data;
  console.log(alo);
  const izvlacenjePodataka = () => {
    let nesto = alo.map((artikal, id) => {
      // console.log(artikal);
      return { nesto };
    });
  };
  return <div>{izvlacenjePodataka}</div>;
}
